?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Данный бренд был создан примерно в 20-х годах 20-го века часовым мастером Жакуисом Бейфортом. Именно тогда он решил создавать часы очень высокого класса. Золотой корпус, высококачественный механизм, бриллианты с золотыми браслетами все эти атрибуты уже в то время присутствовали в часах Elysee (что на тот момент являлось инновацией). Все бы ничего, но Вторая Мировая война помешала Жакуису Бейфорту развивать его бизнес. Компания была возрождена только в 1960 году немецкой фирмой Xapep. Причем, эта фирма решила не нарушать традиции знаменитого мастера, а выпускать такие же часы под таким же брендом. Компания возродилась и стала не менее популярна, чем прежде. Минуло еще около 30-ти лет. Бренд вновь перешел к новому хозяину, теперь уже к Р. Зойме. Он также стремился сохранить первоначальный вид часов, при этом добавить в них незначительные новшества, что сказалось на выпуске многочисленных новых коллекций. На данный момент, часы марки Elysee продаются примерно в 27-ми странах, что для немецкой марки часов, является, чуть ли не рекордом. Ассортимент, традиционно, делится на мужские и женские наручные часы. Кстати, разнообразие коллекций, ровно, как и их отличие друг от друга, просто поражают. Стоит отметить, что часы Elysee имеют разную стоимость, и это означает то, что приобрести их способен практически каждый любитель первоклассных часов.</span></span></p>
 
